import React from 'react'
import "../App.css";
import {BlogContainer, BlogWrapper, BlogTitle} from './BlogElements'
/* import { Link, Route } from 'react-router-dom' */



function Blog() {
    return (
        <>
        <BlogContainer>
            <BlogWrapper>
                <BlogTitle>Blog page</BlogTitle>
            </BlogWrapper>
        </BlogContainer>
        </>
    )
}
export default Blog;
